sourcesContent:
import Courses from '../models/courses.model'

export const checkDuplicateName = async (req, res, next) => { // Funcin para verificar si el nombre del curso que se est intentando crear ya existe
  const { nombre } = req.body // Destructuracin del req.body para la obtencin del nombre
  const name = await Courses.findOne({ nombre }) // Consulta para saber si ese nombre ya existe en la coleccin Courses
  if (name) {
    return res.status(400).json({ message: 'Ya existe un curso con este nombre.' }) // message de respuesta si existe el nombre
  } else {
    next() // Si no est duplicados el nombre, entonces contina la operacin
  }
}

