sourcesContent:
import Users from '../models/users.model'
import Courses from '../models/courses.model'

export const checkUndoDuplicateCode = async (req, res, next) => { // Funcin para verificar si el cdigo del usuario que se est intentando inscribir ya existe en un curso
    const { codigo } = req.body // Destructuracin del req.body para la obtencin del cdigo
    const { courseId } = req.params // Obtencin del curso al que se est intentando inscribir el usuario

    // Busca al usuario por su cdigo
    const userFound = await Users.findOne({ codigo }).populate('rol')
    if (!userFound) return res.status(404).json({ message: 'Lo siento, pero el cdigo de usuario ingresado no corresponde a ninguna cuenta existente. Por favor, verifica el cdigo de usuario e intenta de nuevo.' })
    else {
        next()
    }
}

