import { z } from 'zod'

export const loginSchema = z.object({
  codigo: z.string({
    required_error: 'El cdigo es requerido.'
  }).length(7, { message: 'La longitud del cdigo debe ser 7 caracteres.' })
    .refine(codigo => !isNaN(Number(codigo)), { message: 'El cdigo debe ser nmerico.' }),
  password: z.string({
    required_error: 'La contrasea es requerida.'
  }).min(14, { message: 'La contrasea debe contener mnimo 14 caracteres.' }).max(32, { message: 'La contrasea debe contener mximo 32 caracteres.' })
})

