import Roles from '../models/roles.model.js'
import Users from '../models/users.model.js'

export const checkDuplicateCodeOrEmail = async (req, res, next) => { // Funcin para verificar si el cdigo o el correo del usuario que se est intentando crear ya existe
  const { codigo, correo } = req.body // Destructuracin del req.body para la obtencin del cdigo y el correo
  const code = await Users.findOne({ codigo }) // Consulta para saber si ese cdigo ya existe en la coleccin Users
  if (code) {
    return res.status(400).json({ message: 'Ya existe un usuario con este cdigo.' }) // message de respuesta si existe el cdigo
  }
  const email = await Users.findOne({ correo }) // Consulta para saber si ese correo ya existe en la coleccin Users
  if (email) {
    return res.status(400).json({ message: 'Ya existe un usuario con este correo electrnico.' }) // message de respuesta si existe el correo
  } else {
    next() // Si no estn duplicados el codigo y/o el correo, entonces contina la operacin
  }
}

export const checkRolExisted = async (req, res, next) => { // Funcin que verifica los roles de los usuarios que se estn intentando crear
  const { rol } = req.body // Destructuracin para obtener el rol de req.body
  if (rol) {
    const rolSave = await Roles.findOne({ nombre: rol }) // Consulta para verificar que existe el nombre del rol que se est pasando en el body con los que estn en DB
    if (!rolSave) {
      return res.status(400).json({ message: `El rol ${rol} no existe.` }) // message que indica que el rol no existe
    } else {
      next()
    } // Si el rol existe, entonces contina la operacin
  }
}

