import z from 'zod'

export const inscribeUsersSchema = z.object({
    codigo: z.string({
        required_error: 'El cdigo es requerido.'
      }).length(7, { message: 'La longitud del cdigo es de 7 caracteres.' })
        .refine(codigo => !isNaN(Number(codigo)), { message: 'El cdigo debe ser nmerico.' })
})

