sourcesContent:
import { z } from 'zod'
import { toDate } from 'date-fns-tz' 

const isTodayOrLater = (dateString) => {
  console.log(dateString)
  const timeZone = 'America/Bogota'  // zona horaria

  // Convertir la fecha de entrada a una fecha en la zona horaria especificada
  const inputDate = toDate(dateString, { timeZone }) 

  // Obtener la fecha y hora actual en la zona horaria especificada
  const now = new Date() 
  const nowInTimeZone = toDate(now, { timeZone }) 

  // Comparar las fechas
  return inputDate >= nowInTimeZone 
} 

export const homeworkSchema = z.object({
  nombre: z.string({
    required_error: 'El nombre del curso es necesario para el registro.'
  }).min(1, { message: 'El nombre debe contener mnimo 1 caracter.' })
    .max(50, { message: 'El nombre debe contener mximo 50 caracteres.' }),
  calificacionMaxima: z.number({
    required_error: 'La calificacin mxima es requerida.',
    invalid_type_error: 'La calificacin mxima debe ser un nmero de precisin doble.'
  }).min(0, { message: 'La calificacin mxima es de mnimo 0' })
    .max(5.0, { message: 'La calificacin mxima es de mximo 5.0' }),
  descripcion: z.string({
    required_error: 'La descripcin es requerida.'
  }).min(20, { message: 'La descripcin debe contener al menos 20 caracteres' })
    .max(200, { message: 'La descripcin tiene una longitud mxima de 200 caracteres.' }),
  fecha: z.string({
    required_error: 'La fecha es requerida'
  }).refine(value => isTodayOrLater(value), {
    message: 'La fecha y hora no pueden ser anterior a la actual.'
  })
})

