    fechaEntrega: {
        type: Date,
        require: true
    },
    pdfFile: {
        ref: 'PdfFile',
        require: true,
        type: Schema.Types.ObjectId
    },
    curso: {
        ref: 'Courses',
        require: true,
        type: Schema.Types.ObjectId
    }
}, { 
    timestamps: true,
    versionKey: false
})

export default model('Homework', homeworkSchema)

